    public function executeGrafica(sfWebRequest $request) {
        $BaseImagen = 'data:image/png;base64,';
        $imagen = $request->getParameter('imagen');
        if ($imagen) {
            $BaseImagen = $imagen;
            $carpetaArchivos = sfConfig::get('sf_upload_dir');
            $BaseImagen = str_replace('src="', " ", $BaseImagen);
            $Base64Img = str_replace('"', " ", $BaseImagen);
            $Base = explode('alt=', $Base64Img);
            $Base64Img = trim($Base[0]);
            list(, $Base64Img) = explode(';', $Base64Img);
            list(, $Base64Img) = explode(',', $Base64Img);
            $Base64Img = base64_decode($Base64Img);
             $filename = 'grafica3.png';
            $urlImagen = $carpetaArchivos . DIRECTORY_SEPARATOR . 'empresas' . DIRECTORY_SEPARATOR . $filename;
            file_put_contents($urlImagen, $Base64Img);
            $servidor = $_SERVER['SERVER_NAME'];
            $urlguarda = 'http://' . $servidor . '/uploads/articulo/' . $filename;

            $imagen = substr($imagen, 0, 80);
            $paremtro = ParametroQuery::create()
                    ->findOne();
            $paremtro->setSlogan($imagen);
            $paremtro->save();
        }
        echo "actuaizad";
        die();
    }

    /**
     *  18 000 5465108
     * Executes index action
     *
     * @param sfRequest $request A request object
     */
    public function executeAsiste(sfWebRequest $request) {
        $this->getResponse()->setContentType('application/json');
        $this->getResponse()->setContentType('charset=utf-8');
        $token = $request->getParameter('token');
        $fechaHora = $request->getParameter('fecha');
        $hora = $request->getParameter('hora');
        $dia = $request->getParameter('dia');
        $usuario = $request->getParameter('usuario');
        $resultado['mensaje'] = 'TOKEN NO VALIDO';
        if ($token <> "bbba722f948709955de06b9e2a7e703e3bc15996") {
            $resultado['valido'] = 0;
            $resultado['mensaje'] = 'TOKEN NO VALIDO';
            $data_json = json_encode($resultado);
            return $this->renderText($data_json);
        }
        $resultado['mensaje'] = 'TOKEN NO VALIDO';
        $usuarioQ = null;
        if ($usuario) {
            $usuarioQ = UsuarioQuery::create()->findOneByCodigo($usuario);
        }
        if (!$usuarioQ) {
            $resultado['valido'] = 0;
            $resultado['mensaje'] = 'USUARIO NO ENCONTRADO';
            $data_json = json_encode($resultado);
            return $this->renderText($data_json);
        }
        if (!$fechaHora) {
            $resultado['valido'] = 0;
            $resultado['mensaje'] = 'FECHA NO RECIBIDA';
            $data_json = json_encode($resultado);
            return $this->renderText($data_json);
        }

        $con = Propel::getConnection();
        $con->beginTransaction();
        try {
            if ($usuarioQ) {

                $asistencia = AsistenciaUsuarioQuery::create()
                        ->filterByFechaHora($fechaHora)
                        ->filterByUsuario($usuarioQ->getUsuario())
                        ->findOne();
                if (!$asistencia) {
                    $asistencia = new AsistenciaUsuario();
                    $asistencia->setUsuario($usuarioQ->getUsuario());
                    $asistencia->setFechaHora($fechaHora);
                    $asistencia->setDia($dia);
                    $asistencia->setHora($hora);
                    $asistencia->save();
                }
            }
            $con->commit();
//                echo "<pre>";
//                print_r($asistencia);
//                echo "</pre>";
//                die();
            $resultado['valido'] = 1;
            $resultado['mensaje'] = 'ACTUALIZADO';
            $data_json = json_encode($resultado);
            return $this->renderText($data_json);
        } catch (Exception $e) {
            $resultado['valido'] = 0;
            $resultado['mensaje'] = $e->getMessage();
            $data_json = json_encode($resultado);
            return $this->renderText($data_json);
            $con->rollback();
        }
    }

}
